import "./style.css"
const Student = ({arrNumeros,color}) => {

    console.log(arrNumeros[0].alive)
    return(
        <>
            {arrNumeros.map((e) => <li key={e.name}>
                <figure ><img style={{ border: `5px solid ${color}`}}  src={e.image === "" ? "./desconhecido.png" : e.image} alt={e.name}></img></figure>
