                <h3 style={{ color: color }} >{e.actor}</h3>
                <p>Data Nascimento: {e.dateOfBirth}</p>
                <p>esta vivo: {e.alive}</p>
                <p>Casa: {e.house}</p>
            </li>)}
        </>
    )
}

export default Student
